webpackJsonp([6],{"./node_modules/json-loader/index.js!./.cache/json/about.json":function(t,e){t.exports={data:{site:{siteMetadata:{title:"Fuck Up Some Comics",author:"Austin Lanari"}},markdownRemark:{id:"/home/austin/newFusc/FuSC/src/pages/about/index.md absPath of file >>> MarkdownRemark",html:"<p itemscope itemtype='http://schema.org/AboutPage'>\nI'm <span itemprop='about'>Austin Lanari</span>. By day I'm a Software Engineer, so I thought I'd make my own site for writing about comics.\n</p>\n<p>Things got out of hand pretty quick.</p>\n<p>I got really excited about designing a simple progressive web app (add this site to your home screen and it will behave pretty similar to a native app, which is awesome), and haven’t been writing about comics quite as much as I planned.  But, I’ll get there.\nIn the mean time, I still slog through challenging, small press work and do my best to share my thoughts over on <a href=\"&#x27;http://www.comicsbulletin.com&#x27;\">Comics Bulletin</a></p>\n<p>In the short-term, I plan on fusing this blog with writing a little more about coding. That might mean I have to change the blog’s semi-official name right now (despite the fact that it’s Future’s world and we’re all just living in it), but, it <em>might</em> turn out alright not to have the ‘fuck’ word in my main website.</p>\n<p><em>Might</em>.</p>\n<p>If you want to see more bite-sized rants, <a href=\"&#x27;https://www.twitter.com/austinlanari&#x27;\">Twitter is where to find me</a>. It’s also the best way to contact me.  Now go read about some comics.</p>",fields:{slug:"/about/"},frontmatter:{title:"About",date:"Invalid date",indexImage:null,layout:"page",description:null}}},pathContext:{slug:"/about/"}}}});
